package ee.taltech.iti0200.idcode;

import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;

import static java.lang.Character.isDigit;


public class IdCode {
    static final int GENDER_START = 0;
    static final int GENDER_END = 1;
    static final int YEAR_START = 1;
    static final int YEAR_END = 3;
    static final int MONTH_START = 3;
    static final int MONTH_END = 5;
    static final int DAY_START = 5;
    static final int DAY_END = 7;
    static final int QUEUE_START = 7;
    static final int QUEUE_END = 10;
    static final int MIN_GENDER = 1;
    static final int MAX_GENDER = 6;
    static final int MIN_QUEUE = 0;
    static final int MAX_QUEUE = 999;
    static final int MIN_YEAR = 0;
    static final int MAX_YEAR = 99;
    static final int MIN_MONTH = 1;
    static final int MAX_MONTH = 12;
    static final int CENT_19 = 1800;
    static final int CENT_20 = 1900;
    static final int CENT_21 = 2000;
    static final int MONTH_28 = 28;
    static final int MONTH_30 = 30;
    static final int MONTH_31 = 31;
    static final int ID_CODE_LEN = 11;
    static final int SIX = 6;
    static final int SEVEN = 7;
    static final int EIGHT = 8;
    static final int NINE = 9;

    private final String idCodeValue;

    enum Gender {
        MALE, FEMALE
    }

    public String getIdCodeValue() {
        return idCodeValue;
    }

    public IdCode(String idCodeValue) {
        this.idCodeValue = idCodeValue;
    }

    public boolean isCorrect() {
        if (!isGenderNumberCorrect()) {
            return false;
        } else if (!isYearNumberCorrect()) {
            return false;
        } else if (!isMonthNumberCorrect()) {
            return false;
        } else if (!isDayNumberCorrect()) {
            return false;
        } else if (!isQueueNumberCorrect()) {
            return false;
        } else return isControlNumberCorrect();
    }

    public String getInformation() {
        if (isCorrect()) {
            String dayNumber = getIdCodeValue().substring(DAY_START, DAY_END);
            String monthNumber = getIdCodeValue().substring(MONTH_START, MONTH_END);
            return "This is a " + getGender() + " born on " + dayNumber + "." + monthNumber + "."
                    + getFullYear() + " in " + getBirthPlace();
        } else {
            return "Given invalid ID code!";
        }
    }

    public Gender getGender() {
        Gender gender;
        if (isGenderNumberCorrect()) {
            if (Integer.parseInt(getIdCodeValue().substring(GENDER_START, GENDER_END)) % 2 == 0) {
                gender = Gender.FEMALE;
            } else {
                gender = Gender.MALE;
            }
            return gender;
        } else {
            return null;
        }
    }

    public String getBirthPlace() {
        return null;
    }

    public int getFullYear() {
        if (isGenderNumberCorrect() && isYearNumberCorrect()) {
            int genderNumber = Integer.parseInt(getIdCodeValue().substring(GENDER_START, GENDER_END));
            int yearNumber = Integer.parseInt(getIdCodeValue().substring(YEAR_START, YEAR_END));
            if (genderNumber < MIN_GENDER + 3) {
                return CENT_19 + yearNumber;
            } else if (genderNumber >= MAX_GENDER - 1) {
                return CENT_21 + yearNumber;
            } else {
                return CENT_20 + yearNumber;
            }
        } else {
            return -1;
        }
    }

    private boolean isGenderNumberCorrect() {
        if (!isDigit(getIdCodeValue().charAt(0))) {
            return false;
        }
        int genderNumber = Integer.parseInt(getIdCodeValue().substring(GENDER_START, GENDER_END));
        return MIN_GENDER <= genderNumber && genderNumber <= MAX_GENDER;
    }

    private boolean isYearNumberCorrect() {
        if (!getIdCodeValue().substring(YEAR_START, YEAR_END).chars().allMatch(Character::isDigit)) {
            return false;
        }
        int yearNumber = Integer.parseInt(getIdCodeValue().substring(YEAR_START, YEAR_END));
        return MIN_YEAR <= yearNumber && yearNumber <= MAX_YEAR;
    }

    private boolean isMonthNumberCorrect() {
        if (!getIdCodeValue().substring(MONTH_START, MONTH_END).chars().allMatch(Character::isDigit)) {
            return false;
        }
        int monthNumber = Integer.parseInt(getIdCodeValue().substring(MONTH_START, MONTH_END));
        return MIN_MONTH <= monthNumber && monthNumber <= MAX_MONTH;
    }

    private boolean isDayNumberCorrect() {
        if (!getIdCodeValue().substring(MONTH_START, MONTH_END).chars().allMatch(Character::isDigit)
                || !getIdCodeValue().substring(DAY_START, DAY_END).chars().allMatch(Character::isDigit)) {
            return false;
        }
        List<Integer> daysInMonth = new ArrayList<>(Arrays.asList(MONTH_31, MONTH_28, MONTH_31, MONTH_30,
                MONTH_31, MONTH_30, MONTH_31, MONTH_31, MONTH_30, MONTH_31, MONTH_30, MONTH_31));
        int fullYear = getFullYear();

        if (fullYear == -1) {
            return false;
        }

        int dayNumber = Integer.parseInt(getIdCodeValue().substring(DAY_START, DAY_END));
        int monthNumber = Integer.parseInt(getIdCodeValue().substring(MONTH_START, MONTH_END));

        if (monthNumber == 2) {
            if (isLeapYear(fullYear)) {
                return dayNumber <= MONTH_28 + 1;
            } else {
                return dayNumber <= MONTH_28;
            }
        } else {
            return dayNumber <= daysInMonth.get(monthNumber - 1);
        }
    }

    private boolean isQueueNumberCorrect() {
        if (!getIdCodeValue().substring(QUEUE_START, QUEUE_END).chars().allMatch(Character::isDigit)) {
            return false;
        }
        int queueNumber = Integer.parseInt(getIdCodeValue().substring(QUEUE_START, QUEUE_END));
        return MIN_QUEUE <= queueNumber && queueNumber <= MAX_QUEUE;
    }

    private boolean isControlNumberCorrect() {
        if (getIdCodeValue().length() < ID_CODE_LEN || !getIdCodeValue().chars().allMatch(Character::isDigit)) {
            return false;
        }

        List<Integer> multipliers1 = new ArrayList<>(Arrays.asList(1, 2, 3, 4, 5, SIX, SEVEN, EIGHT, NINE, 1));
        List<Integer> multipliers2 = new ArrayList<>(Arrays.asList(3, 4, 5, SIX, SEVEN, EIGHT, NINE, 1, 2, 3));
        int controlNumber, control1 = 0, control2 = 0;

        for (int i = 0; i <= 9; i++) {
            control1 += Integer.parseInt(getIdCodeValue().substring(i, i + 1)) * multipliers1.get(i);
            control2 += Integer.parseInt(getIdCodeValue().substring(i, i + 1)) * multipliers2.get(i);
        }
        control1 = control1 % ID_CODE_LEN;
        control2 = control2 % ID_CODE_LEN;

        if (control1 != 10) {
            controlNumber = control1;
        } else if (control2 != 10) {
            controlNumber = control2;
        } else {
            controlNumber = 0;
        }

        return Integer.parseInt(getIdCodeValue().substring(QUEUE_END)) == controlNumber;
    }

    private boolean isLeapYear(int fullYear) {
        if (fullYear % 4 == 0) {
            if (fullYear % 100 == 0) {
                return fullYear % (4 * 100) == 0;
            } else {
                return true;
            }
        } else {
            return false;
        }
    }

    public static void main(String[] args) {
        IdCode validMaleIdCode = new IdCode("a7605030299");
        System.out.println(validMaleIdCode.isCorrect());
        System.out.println(validMaleIdCode.getInformation());
        System.out.println(validMaleIdCode.getGender());
        System.out.println(validMaleIdCode.getBirthPlace());
        System.out.println(validMaleIdCode.getFullYear());
        System.out.println(validMaleIdCode.isGenderNumberCorrect());
        System.out.println(validMaleIdCode.isYearNumberCorrect());
        System.out.println(validMaleIdCode.isMonthNumberCorrect());
        System.out.println(validMaleIdCode.isDayNumberCorrect());
        System.out.println(validMaleIdCode.isQueueNumberCorrect());
        System.out.println(validMaleIdCode.isControlNumberCorrect());
        System.out.println(validMaleIdCode.isLeapYear(validMaleIdCode.getFullYear()));
    }

}

