EX01 Checking personal ID code validity
=======================================

Kaust Gitis: ``EX01IdCode``

Pakk Gitis: ``ee.taltech.iti0200.idcode``

Ülesande eesmärk on koostada programm, mis kontrollib isikukoodi korrektsust.

Isikukoodi numbrid, nende tähendused ja piirangud
-------------------------------------------------

Isikukood koosneb täpselt **11** numbrist.

Numbrite tähendused:

**esimene** number:

- **1** - aastail 1800-1899 sündinud mees
- **2** - aastail 1800-1899 sündinud naine
- **3** - aastail 1900-1999 sündinud mees
- **4** - aastail 1900-1999 sündinud naine
- **5** - aastail 2000-2099 sündinud mees
- **6** - aastail 2000-2099 sündinud naine

**teine** ja **kolmas** number:

- sünniaasta **2** viimast numbrit *(nt 00, 01, 75 jne kuni 99)*

**neljas** ja **viies** number:

- sünnikuu number *(nt jaanuar - 01, veebruar - 02 jne, kuni 12)*

**kuues** ja **seitsmes** number:

- sünnikuupäeva number *(nt 01, 08, 20 jne kuni 28, 29, 30 või 31 vastavalt
  sünnikuule)*

**kaheksas**, **üheksas** ja **kümnes** number:

- sellel päeval sündinu järjekorranumber *(nt 000, 012 jne kuni 999)*

**NB!**
Kui kodanik on sündinud pärast 2012. aastat, siis temal sünnikoha linn puudub. Alates 2013. aastast on
isikukoodi numbrid **kaheksas**, **üheksas** ja **kümnes** järjekorra numbrid.

Siin on välja toodud võimalikud linnad, kus inimene on sündinud. Need linnad peavad olema
kasutatud funktsioonis ``getBirthPlace``, kus tuleb tagastada üks allolevatest linnadest.

* 001...010 = Kuressaare
* 011...020 = Tartu
* 021...220 = Tallinn
* 221...270 = Kohtla-Järve
* 271...370 = Tartu
* 371...420 = Narva
* 421...470 = Pärnu
* 471...490 = Tallinn
* 491...520 = Paide
* 521...570 = Rakvere
* 571...600 = Valga
* 601...650 = Viljandi
* 651...710 = Võru
* 711...000 = null

**üheteistkümnes** number:

- kontrollnumber, mis arvutatakse teiste numbrite pealt, vaata `Kontrollnumbri arvutamise algoritm`_


Ülesanne
--------

Programm koosneb mitmest funktsioonist (meetodist), mis kontrollivad isikukoodi
erinevaid komponente.

Kaks põhimeetodit (``isCorrect``, ``getInformation``) ja ``get``-meetodid on ``public`` nähtavusega,
ülejäänud on ``private``. Juba alguses on soovituslik hakata õppima, milles seisnevad
muutujate, meetodite jne tüüpide erinevused, eeldused ja puudused ning mis olukorras
milline sobiks paremini. Praeguses ülesandes on näha, et kõik "üksikud" kontrollid on ``private`` nähtavusega.
Selle põhjuseks on see, et neid kontrolle teostab program nö "taustal". Kasutaja soovib teada ainult
oma isikukoodi korrektsust ja saada infot selle inimese kohta. Ülejäänud tegevused, tänu millele
saadaksegi õige tulemus, teda ei huvita (ehk siis tal ei ole põhjust ega vajadust neid otse välja kutsuda).
Sellisel juhul tavaliselt piiratakse liigipääs nendele
meetoditele - teeme neid privaatseteks.

Soo valik on kujutatud ``enum``-andmetüübina, sest soo võimalikke väärtusi on piiratud hulk (selles ülesandes 2). Rohkem
enum-ist saab lugeda `siit <https://ained.ttu.ee/javadoc/oop/oop-enum.html>`_

Antud ülesande puhul ärge valideerige konstruktoris isikukoodi korrektsust. Konstruktor aktsepteerib igasuguse sõne. Valideerimiseks on ``isCorrect()`` meetod. Kõik teised meetodid peavad tööle minema ka ebakorrektse isikukoodiga. Ehk siis näiteks soo valideerimisel peab see meetod töötama ka isikukoodiga ``"1"`` (meetod kontrollib vaid esimest sümbolit).

* ``public boolean isCorrect()`` - peamine funktsioon, mis kontrollib isikukoodi korrektsust.
  Kasutab teisi ehk
  kontroll-funktsioone, tagastab ``true`` või ``false``;
* ``public String getInformation()`` - peamine funktsioon, mis kogub infot
  abifunktsioonidest, tagastab sõne **This is a {sugu} born on
  {DD.MM.YYYY} in {linn}** kui linn on puudu, siis asendada {linn} null-iga. Kui isikukood on vale (kasuta ``isCorrect()`` funktsiooni kontrollimiseks), siis tagastada ``"Given invalid ID code!"``;
* ``public Gender getGender()`` - tuvastab isikukoodi esimese numbri põhjal, milline sugu on inimesel.
  Tagastab vastava enum väärtuse, tagastada null kui mittesobiv väärtus;
* ``public int getFullYear()`` - tagastab isikukoodi aasta ja soo numbrite
  abil 4-kohalise aastanumbri - **18--**, **19--** või **20--** kui sisendina antud isikukood pole tõlgendatav, siis tagastada -1;
* ``public String getBirthPlace()`` - tagastab linna nime sõnena kus inimene on sündinud, tagastada null kui linn on puudu. Kui isikukoodi järjekorranumbri osa on vale (kasuta ``isQueueNumberCorrect()`` funktsiooni kontrollimiseks), siis tagastada ``"Wrong input!"``;
* ``private boolean isGenderNumberCorrect()`` - kontrollib soo numbrit, tagastab
  ``true`` või ``false``;
* ``private boolean isYearNumberCorrect()`` - kontrollib aasta numbreid,
  tagastab ``true`` või ``false``;
* ``private boolean isMonthNumberCorrect()`` - kontrollib kuu numbreid, tagastab
  ``true`` või ``false``;
* ``private boolean isDayNumberCorrect()`` - kontrollib kuupäeva numbreid; peab kindlasti vaatama seda,
  millises kuus on 30 või 31 päeva ja arvestama ka veebruari päevade arvu erisusega, tagastab ``true``
  või ``false``;
  **NB! Kontrollides, kas kuus on 30 või 31 päeva, ei tohi lihtsalt
  kirja panna kõik sobivad kuud tingimuslausete sisse, proovige leida kuu numbri
  ja päevade arvu seos.**
  **NB! Enne liigasta kontrollimist tuleb koostada isikukoodis antud aasta
  kahest viimastest numbrist aasta terve neljakohaline arv. Selleks võib
  kasutada funktsioone, mis on mõeldud sõnumi koostamiseks!**
* ``private boolean isQueueNumberCorrect()`` - kontrollib sündinu järjenumbrit, tagastab
  ``true`` või ``false``;
* ``private boolean isControlNumberCorrect()`` - kontrollib kontrollnumbri
  korrektsust kasutades (`Kontrollnumbri arvutamise algoritm`_) , tagastab ``true`` või ``false``;
* ``private boolean isLeapYear(int fullYear)`` - abifunktsioon, mis aitab aru saada, kas
  tegemist on liigaastaga või mitte. Selle funktsiooni sisendiks on juba
  **neljakohaline** aastaarv. Tagastab ``true`` või ``false``;


