**2. Liigaasta** ja selle leidmine

Aasta on liigaasta, kui aastaarv jagub 4-ga, välja arvatud juhul, kui ta jagub
100-ga, ent mitte 400-ga.
Natukene täpsem seletus:

1. Kõik aastad, kus aastaarv jagub **400-ga**, **on** kindlasti **liigaastad**
2. Kõik aastad, kus aastaarv jagub **100-ga**, **ei ole** liigaastad
3. Kõik aastad, kus aastaarv jagub **4-ga**, **on** ka **liigaastad**

Liigaastad **on**: 4, 40, 2016, 2000, 1600

Liigaastad **pole**: 3, 41, 2018, 1900, 1800

package ee.taltech.iti0200.idcode;

import static ee.taltech.iti0200.idcode.IdCode.Gender.FEMALE;
import static ee.taltech.iti0200.idcode.IdCode.Gender.MALE;
import static java.time.Year.isLeap;
import static java.util.Arrays.asList;

import java.time.LocalDate;
import java.time.format.DateTimeFormatter;
import java.time.format.DateTimeParseException;
import java.time.format.ResolverStyle;
import java.util.List;
import java.util.NavigableMap;
import java.util.TreeMap;
import java.util.stream.IntStream;

public class IdCode {

  private final String idCodeValue;
  private static final DateTimeFormatter estFormatter = DateTimeFormatter.ofPattern("dd.MM.uuuu");
  private final DateTimeFormatter isoFormatter = DateTimeFormatter.ofPattern("uuuu-M-d").withResolverStyle(ResolverStyle.STRICT);

  enum Gender {
    MALE, FEMALE
  }

  public IdCode(String idCodeValue) {
    this.idCodeValue = idCodeValue;
  }

  public String getIdCodeValue() {
    return idCodeValue;
  }

  private boolean isGenderNumberCorrect() {
    try {
      return parseGenderNumber(idCodeValue) >= 1 && parseGenderNumber(idCodeValue) <= 6;
    } catch (NumberFormatException ex) {
      return false;
    }
  }

  private boolean isYearNumberCorrect() {
    return parseDate() != null;
  }

  private boolean isMonthNumberCorrect() {
    return parseDate() != null;
  }

  private boolean isDayNumberCorrect() {
    return parseDate() != null;
  }

  private boolean isQueueNumberCorrect() {
    if (containsPlusOrMinusSign()) {
      return false;
    }
    try {
      parseQueueNumber(idCodeValue);
    } catch (NumberFormatException ex) {
      return false;
    }
    return true;
  }

  private boolean isControlNumberCorrect() {
    List<Integer> firstMultipliers = asList(1, 2, 3, 4, 5, 6, 7, 8, 9, 1);
    List<Integer> secondMultipliers = asList(3, 4, 5, 6, 7, 8, 9, 1, 2, 3);
    try {
      int sum = IntStream.range(0, firstMultipliers.size())
          .map(i -> (firstMultipliers.get(i)) * Integer.parseInt(idCodeValue.substring(i, i + 1)))
          .sum();
      if (sum % 11 == 10) {
        sum = IntStream.range(0, secondMultipliers.size())
            .map(i -> (secondMultipliers.get(i)) * Integer.parseInt(idCodeValue.substring(i, i + 1)))
            .sum();
      }
      if (sum % 11 == 10) {
        sum = 0;
      }
      int controlNumber = Integer.parseInt(idCodeValue.substring(idCodeValue.length() - 1));
      return sum % 11 == controlNumber;
    } catch (NumberFormatException ex) {
      return false;
    }
  }

  public boolean isCorrect() {
    return isGenderNumberCorrect()
        && isYearNumberCorrect()
        && isMonthNumberCorrect()
        && isDayNumberCorrect()
        && isQueueNumberCorrect()
        && isControlNumberCorrect();
  }

  public Gender getGender() {
    if (!isGenderNumberCorrect()) {
      return null;
    }
    if (parseGenderNumber(idCodeValue) % 2 == 0) {
      return FEMALE;
    }
    return MALE;
  }

  public String getBirthPlace() {
    if (!isQueueNumberCorrect()) {
      return "Wrong input!";
    }
    if (getFullYear() > 2012) {
      return null;
    }
    NavigableMap<Integer, String> birthPlaces = new TreeMap<>();
    birthPlaces.put(1, "Kuressaare");     //    1..10
    birthPlaces.put(11, "Tartu");         //   11..20
    birthPlaces.put(21, "Tallinn");       //  21..220
    birthPlaces.put(221, "Kohtla-Järve"); // 221..270
    birthPlaces.put(271, "Tartu");        // 271..370
    birthPlaces.put(371, "Narva");        // 371..420
    birthPlaces.put(421, "Pärnu");        // 421..470
    birthPlaces.put(471, "Tallinn");      // 471..490
    birthPlaces.put(491, "Paide");        // 491..520
    birthPlaces.put(521, "Rakvere");      // 521..570
    birthPlaces.put(571, "Valga");        // 571..600
    birthPlaces.put(601, "Viljandi");     // 601..650
    birthPlaces.put(651, "Võru");         // 651..710
    birthPlaces.put(711, null);           // 711..999

    return birthPlaces.floorEntry(parseQueueNumber(idCodeValue)).getValue();
  }

  public String getInformation() {
    if (!isCorrect()) {
      return "Given invalid ID code!";
    }
    return String.format("This is a %s born on %s in %s", getGender(), parseDate(), getBirthPlace());
  }

  private boolean isLeapYear(int fullYear) {
    return isLeap(fullYear);
  }

  public int getFullYear() {
    try {
      int century = 17;
      int offSet = (int) Math.ceil(parseGenderNumber(idCodeValue) / 2.0);
      century += offSet;
      return Integer.parseInt(century + parseYearNumberAsString(idCodeValue));
    } catch (NumberFormatException ex) {
      return -1;
    }
  }


  private static int parseGenderNumber(String idCode) {
    return Integer.parseInt(idCode.substring(0, 1));
  }

  private static String parseYearNumberAsString(String idCode) {
    return idCode.substring(1, 3);
  }

