    return Integer.parseInt(idCode.substring(3, 5));
  }

  private static int parseDayNumber(String idCode) {
    return Integer.parseInt(idCode.substring(5, 7));
  }

  private static int parseQueueNumber(String idCode) {
    return Integer.parseInt(idCode.substring(7, 10));
  }

  private boolean containsPlusOrMinusSign() {
    return idCodeValue.contains("+") || idCodeValue.contains("-");
  }

  private String parseDate() {
    if (containsPlusOrMinusSign()) {
      return null;
    }
    try {
      LocalDate date = LocalDate.parse(getFullYear() + "-" + parseMonthNumber(idCodeValue) + "-" + parseDayNumber(idCodeValue), isoFormatter);
      return date.format(estFormatter);
    } catch (DateTimeParseException | NumberFormatException ex) {
      return null;
    }
  }

